INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(9, 'HelloWorldDescription', 'Essa é uma página de exemplo', 'This is an Example Page', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(10, 'HowToStart', 'Se você chegou até aqui, seu ambiente de trabalho já está corretamente instalado e pronto para ser utilizado. Foi instalado o Banco de Dados e foi criado um espaço em um servidor para hospedagem dos arquivos que compõem esse ambiente.</p>\r\n<p>Se for necessária uma nova instalação ou uma instalação em outro servidor, consulte as <a href=installation.php>Instruções de Instalação</a>.</p>\r\n<p>No servidor operante, os arquivos ficam distribuídos em pastas de acordo com suas finalidades específicas. Essas pastas serão melhor apresentadas ao longo dessa documentação:', 'You are already here, your work environment is ready and ready to be used. The Database was installed and a space was created on a server for hosting the files that make up that environment. </ P>', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(11, 'EiffelFramework', 'Plataforma Livin\'', 'Livin\' Framework', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(12, 'FrameworkDescription', 'Plataforma de desenvolvimento rápido de aplicações para a web', 'Fast application development platform for the web', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(13, 'FoldersDescription', 'Para resumir:\r\n<ul>\r\n<li><b>api</b><br />Onde opcionalmente serão armazenadas as APIs de comunicação com sistemas ou equipamentos de terceiros;</li>\r\n<li><b>apps</b><br />Local determinado para armazenamento das aplicações desenvolvidas com a utilização da plataforma;</li>\r\n<li><b>assets</b><br />Como padrão, é a pasta que armazena as imagens e folhas de estilos que podem ser customizadas para cada projeto;</li>\r\n<li><b>core</b><br />Aqui ficam os principais arquivos e rotinas básicas do sistema. É onde ficam armazenadas as versões de produção do Bootstrap, da jQuery e da biblioteca Limitless. Nessa pasta ficam também todos os plugins utilizados pela plataforma;</li>\r\n<li><b>files</b><br />Espaço destinado a armazenar os arquivos controlados pelo Gerenciador de Disco Virtual da plataforma;</li>\r\n<li><b>modules</b><br />Aqui ficam os módulos de manutenção interna do sistema: Cadastro de Usuários, Permissões, Log etc..</li>\r\n<li><b>widgets</b><br />As Widgets (pequenos aplicativos secundários que podem ser invocados para aparecerem dentro de outras páginas no sistema) ficam armazenadas nessa pasta;</li>\r\n<li><b>index.php</b><br />É o arquivo de entrada que carrega todos os scripts necessários para a montagem desse ambiente.</li>\r\n</ul>\r\nÉ recomendado que os arquivos que compõem essas pastas e são os reponsáveis pela construção do sistema, sejam analizados para uma melhor compreensão do funcionamento da plataforma. Muitas idéias e dicas de programação poderão ser colhidas nesses arquivos. Uma atenção especial poderá ser dada aos arquivos que estão nas pastas "Core" e "Modules".', 'Resuming:\r\n<ul>\r\n<li> <b> api </ b> <br /> Where communication APIs are optionally stored with third-party systems or devices; </ li>\r\n<li> <b> apps </ b> <br /> Location set for storing applications built using the platform; </ li>\r\n<li> <b> assets </ b> <br /> By default, it is the folder that stores the images and stylesheets that can be customized for each project; </ li>\r\n<li> <b> core </ b> <br /> Here are the main files and basic system routines. This is where the production versions of Bootstrap, jQuery, and the Limitless library are stored. In this folder are also all the plugins used by the platform; </ li>\r\n<li> <b> files </ b> <br /> Space intended to store files controlled by the platform\'s Virtual Disk Manager; </ li>\r\n<li> <b> modules </ b> <br /> Here are the system\'s internal maintenance modules: User Registration, Permissions, Logging etc. </ li>\r\n<li> Widgets </ b> <br /> Widgets (small secondary applications that can be invoked to appear inside other pages in the system) are stored in this folder; </ li>\r\n</ li> <li> <li> <li> <li> <li> <li> <li> <li>\r\n</ ul>\r\nIt is recommended that the files that compose these folders and are responsible for the construction of the system, be analyzed for a better understanding of the operation of the platform. Many ideas and programming tips can be gathered from these files. Special attention can be given to files in the "Core" and "Modules" folders.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(14, 'HowIgetHere', 'Mas, Como Cheguei Aqui?', 'But how did I get here?', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(15, 'HowYouGetHere', 'Como você já chegou aqui, percebeu que após o "<b>Login</b>", essa página foi carregada. <b>Como?</b> Simples: Existe no módulo "<b>Opções do Sistema</b>", que fica no grupo de módulos "<b>Manutenção</b>" uma opção chamada "<b>Aplicação Inicial</b>". Nesse campo, qualquer página pertencente do sistema, sub-sistema ou até mesmo uma aplicação externa de terceiros, poderá ser cadastrada para ser carregada na área principal, na abertura do sistema. Experimente preencher com "<b>http://www.oglobo.com.br</b>". Ao entrar no sistema, a página do Jornal "<b>O Globo</b>" aparecerá na área principal do sistema.', 'As you arrived here, you noticed that after the "<b> Login </ b>", this page was loaded. <b> How to? </ b> Simple: There is an option called "<b> Maintenance </ b> in the" <b> System Options </ b> Initial Application </ b> ". In this field, any page belonging to the system, sub-system or even a third-party external application can be registered to be loaded in the main area at the system opening. Try filling in with "<b> http://www.oglobo.com.br </ b>". When you enter the system, the "<b> O Globo </ b>" page will appear in the main area of the system.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(16, 'MyAppHere', 'Colocando Minha Aplicação Aqui', 'Placing My Application Here', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(17, 'YourAppHere', 'Se a sua <b>aplicação foi desenvolvida fora da plataforma</b> (em qualquer linguagem, em qualquer servidor etc.) <b>é só apontar a URL de início</b> da mesma como foi feito com a página do Jornal "O Globo" no exemplo acima. Mas se você deseja desenvolver uma <b>nova aplicação no mesmo ambiente do sistema</b>, você deve criar uma <b>sub-pasta</b> dentro da pasta "\\<b>apps</b>" para armazenar os arquivos que farão parte dessa aplicação. Seu <b>sub-sistema</b> poderá ser desenvolvido <b>em qualquer linguagem de programação</b> suportada pelo servidor onde está hospedado o sistema. Nesse caso, você terá acesso aos "plugins" (dezenas de componentes, à biblioteca "Bootstrap", às rotinas "jQuery" e "mashups" da biblioteca "Limitness"), além das <b>funcões de programação</b> (desenvolvidas em "PHP" e "Javascript") que farão com que suas tarefas de programação sejam mais rápidas, seguras e tenham um melhor desempenho.', 'If your <b> application was developed off-platform </ b> (in any language, on any server, etc.) <b> just point to the start URL </ b> of the same as was done with the "O Globo" newspaper in the above example. But if you want to develop a <b> new application in the same system environment </ b>, you should create a <b> subfolder </ b> in the "\\ <b> apps" folder to store the files that will be part of that application. Your <b> sub-system </ b> can be developed <b> in any programming language </ b> supported by the server where the system is hosted. In this case, you will have access to the "plugins" (dozens of components, the Bootstrap library, the "jQuery" and "mashups" routines of the "Limitness" library), in addition to <b> programming functions </ b> ( developed in "PHP" and "Javascript") that will make your programming tasks faster, safer and perform better.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(18, 'TheNextStep', 'Qual O Próximo Passo?', 'What\'s The Next Step', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(19, 'GoToTemplate', 'Uma vez criada a sub-pasta onde seus arquivos serão colocados, o próximo passo para desenvolver uma aplicação usando a identidade visual e as extensões da plataforma será conhecer a <b>vasta lista de funcionalidades que estão disponíveis</b> para você. Como <b>esse tutorial é baseado em exemplos</b>, o que deve ser feito é analisar um "template" (modelo) que é disponibilizado para esse fim e <b>seguir/aplicar</b> as <b>regras/funções</b> que serão apresentadas à seguir para <b>desenvolver a sua própria aplicação de forma rápida e intuitiva</b>.', 'Once you have created the subfolder where your files will be placed, the next step in developing an application using the visual identity and extensions of the platform will be to get to know the vast list of features that are available to you. As <b> this tutorial is based on examples </ b>, what should be done is to analyze a template that is made available for this purpose and <b> follow / apply </ b> rules / functions </ b> that will be presented below to <b> develop your own application quickly and intuitively </ b>.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(21, 'Starting', 'Criando Sua Aplicação', 'Creating Your Own Page', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(24, 'InitialPage', 'Página Inicial do Sistema', 'System Initial Page', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(26, 'Installation', 'Instruções de Instalação', 'Installation Instructions', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(27, 'FollowTheModel', 'Para desenvolver uma nova aplicação para o sistema, o primeiro passo é criar a página inicial dessa aplicação. <a href=template.php>Clique aqui</a> para visualizar e fazer o download de uma página de exemplo (essa página precisa ser colocada nessa pasta para que funcione corretamente, pois ela depende de arquivos que estão disponibilizados na plataforma). No Código abaixo, são mostradas as funções PHP que essa página utiliza:', 'To develop a new application for the system, the first step is to create the home page for that application. <a href=template.php> Click here </a> to view and download a sample page (this page needs to be placed in this folder in order for it to work correctly because it depends on the files that are available on the platform). In the Code below, the PHP functions that this page uses are shown:', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(28, 'WritingCode', 'No exemplo acima, pode-se observar a inclusão do 3 scripts básicos que incluem em sua página, os elementos essenciais para a utilização da plataforma:\r\n</p>\r\n<ul>\r\n<li><b>config.php</b>: Com as principais configurações da plataforma;</li>\r\n<li><b>functions.php</b>: Abastece a sua página com as funções disponíveis na plataforma;</li>\r\n<li><b>security.php</b>: Como o próprio nome já sugere, é o script responsável pela segurança. Não deixa o código continuar se o usuário não estiver logado;</li>\r\n</ul>\r\n<p>\r\nEm seguida vem o comando para abertura do Banco de Dados que será consumido no decorrer da página. É interessante notar também, as funções "<b>pageHeader</b>" e "<b>pageFooter</b>" que respectivamente auxiliam na montagem do cabeçalho e rodapé da página. Há ainda a função "<b>logWrite</b>" que escreve no Log de Eventos que a página foi acessada. Essas funções e muitas outras, estarão melhor explicadas no tutorial <a href=functions.php>Funções Úteis Disponíveis</a>.\r\n</p>\r\n<p>\r\nAs páginas escritas em PHP misturam além dos próprios comandos PHP, as tags HTML e ocasionalmente códigos Javascript e estilos CSS. É recomendável que nessas págnas, todo esse conteúdo seja escrito em PHP, ou seja, escrevendo as tags HTML e os códigos Javascript e CSS utilizando o comando "<b>echo</b>" e a terminação de linha "<b>\\n</b>". Está comprovado que através dessa notação, o código é executado com um pouco mais de rapidez, e fica muito mais fácil de ser mantido ou debugado.</p>\r\n<br /><p>Veja um exemplo mais completo:', 'Writing The Code', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(29, 'DownloadPage', 'Para fazer o download dessa página, <a href=files/template.zip>Clique Aqui</a>.', 'To download this page, <a href=files/template.zip> Click Here </a>.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(30, 'DataBaseFunctions', 'A plataforma oferece as funções básicas para facilitar o acesso aos bancos de dados. No quadro abaixo é mostrado todo o código necessário para listar os dados de um campo de uma tabela:', 'DataBase Functions', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(31, 'DataBaseConnection', 'Repare que para listar os dados da tabela, foi usada a função "<b>select()</b>", com os parâmetros "<b>campos</b>", "<b>tabela</b>" e "<b>where</b>" (Opcional).</p>\r\n<p>\r\nA conexão com o banco de dados é feita através da função "<b>openDB()</b>". Quando o banco de dados é diferente do banco utilizado pelo sistema, é possível acessá-lo utilizando os parametros com as informações sobre o mesmo na respectiva ordem.', 'DataBase Connection', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(32, 'DataBaseInsert', 'Para inserir novos dados em uma tabela, é usada a função "<b>insert()</b>", com os parâmetros "<b>campos</b>" e "<b>tabela</b>". Os valores deverão estar armazenados previamente em um "<b>array</b>".', 'DataBase Insert', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(33, 'InstallationInstructions', 'Instruções de Instalação', 'Installation Instructions', NULL, NULL);
