	(34, 'UsingPermissions', 'Permissões do Sistema', 'Using Permissions', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(35, 'UsingTranslation', 'Usando a Função de Tradução', 'Using Translation', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(36, 'EventsLogFunction', 'O LOG de Eventos', 'Events Log Function', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(37, 'TableFunctions', 'Criação de Tabelas', 'Table Functions', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(38, 'FormComponents', 'Criação de Formulários', 'Form Components', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(39, 'UsefulFunctions', 'Funções Úteis Disponíveis', 'Useful Functions', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(40, 'SystemUpgrade', 'Atualização do Sistema', 'System Upgrade', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(41, 'TheNewWay', 'O desenvolvimento com <b>Códigos Simples</b> tem ganhado popularidade entre as empresas que trabalham com a criação de sistemas. Essa estrutura de trabalho é focada na plataforma em que o desenvolvimento e a implementação de um software são feitos com mais inteligência, segurança, agilidade e precisão.', 'Development with <b> Simple Codes </ b> has gained popularity among companies working with systems design. This work structure is focused on the platform where the development and implementation of software is done with more intelligence, security, agility and precision.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(42, 'IncreasingProductivity', 'Aumento de Produtividade', 'Increasing Productivity', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(43, 'IncreasingProductivityExplain', 'Ter um time com alto nível de produtividade é um ponto-chave para atingir bons resultados. Se o negócio consegue manter um fluxo de trabalho ágil e preciso, os erros são menos frequentes e os recursos passam a ter maior aproveitamento.', 'Having a team with a high level of productivity is a key to achieving good results. If the business manages to maintain an agile and accurate workflow, errors are less frequent and resources are better exploited.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(44, 'IntuitiveManagement', 'Gestão mais Intuitiva', 'Intuitive Management', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(45, 'IntuitiveManagementExplain', 'O código simples baseado na plataforma torna os processos de desenvolvimento e gestão de softwares mais intuitivos. O código passa a ter um nível de complexidade muito menor, o que auxilia na verificação dos requisitos e na criação de novas funcionalidades.', 'The simple, platform-based code makes software development and management processes more intuitive. The code has a much lower level of complexity, which assists in checking requirements and creating new features.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(46, 'LowRisks', 'Redução de Riscos Durante o Processo de Desenvolvimento', 'Reducing Risks During the Development Process', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(47, 'LowRisksExplain', 'Todo sistema possui bugs e vulnerabilidades. Mas, para garantir que tenha o menor impacto possível na qualidade da ferramenta que é entregue ao usuário, os gestores investem em uma série de estratégias que auxiliam os desenvolvedores a rastrear erros, corrigir vulnerabilidades de segurança e eliminar os demais fatores que possam impactar negativamente na performance do software. Dessa forma, a aplicação que é entregue terá uma experiência de usuário de maior qualidade.</p><p>No código simples baseado em plataforma, esses testes podem ser drasticamente diminuídos, pois a chance de erros é muito menor.', 'Every system has bugs and vulnerabilities. But to ensure that it has the least possible impact on the quality of the tool delivered to the user, managers invest in a number of strategies that help developers track errors, fix security vulnerabilities, and eliminate other factors that may negatively impact performance of the software. In this way, the application that is delivered will have a higher quality user experience. </ P> <p> In simple platform-based code, these tests can be drastically reduced because the chance of errors is much lower.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(48, 'LowCosts', 'Diminuição dos Custos Operacionais', 'Decrease in Operating Costs', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(49, 'LowCostsExplain', 'O desenvolvimento com código simples não requer investimento em softwares onerosos. Pois não tem necessidade de editores que garantam o fluxo entre diversos mecanismos de deploy ou sincronia. Tudo que o programador irá precisar será um Editor de Código, um Utilitário para FTP e uma ferramenta para Auxílio para o Banco de Dados. Essas ferramentas são encontradas com facilidade em versão de domínio público e atá mesmo com código aberto.</p><p>Em um cenário de crise, reduzir custos pode ser o fator fundamental para que a empresa se mantenha rentável. Quando os processos são executados exigindo menos recursos, a empresa pode manter a sua rotina de investimentos e garantir a sua capacidade de inovar.', 'Development with simple code does not require investment in expensive software. For there is no need for editors to guarantee the flow between several mechanisms of deploy or synchrony. All that the programmer will need is a Code Editor, an FTP Utility, and a Database Help tool. These tools are easily found in the public domain version and even open source. </ P> <p> In a crisis scenario, reducing costs can be the key factor in keeping the company profitable. When processes are run requiring less resources, the company can maintain its investment routine and ensure its ability to innovate.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(50, 'MoreScalability', 'Maior Escalabilidade', 'More Scalability', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(51, 'MoreScalabilityExplain', 'A escalabilidade é a capacidade de o negócio ampliar ou reduzir a sua capacidade de trabalho e entrega de produtos a qualquer momento. Em um cenário em que os clientes cobram por uma resposta ágil a mudanças nas demandas de usuários e parceiros comerciais, ser escalável virou um fator diretamente relacionado com o sucesso de um produto.', 'Scalability is the ability of the business to expand or reduce its ability to work and deliver products at any time. In a scenario where customers charge for a responsive response to changes in the demands of users and business partners, scalability has become a factor directly related to the success of a product.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(52, 'TeamEngage', 'Aumento do Engajamento dos Desenvolvedores', 'Increased Developer Engagement', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(53, 'TeamEngageExplain', 'Desenvolvedores engajados são o ponto-chave para que o negócio possa atingir resultados e metas de mercado. Quando a empresa tem equipes comprometidas, o fluxo de trabalho se torna mais ágil: todos buscam mecanismos mais eficazes para entregar resultados e, assim, garantir que a qualidade dos trabalhos desenvolvidos alcancem o resultado esperado.', 'Engaged developers are the key point for the business to achieve results and market goals. When the company has committed teams, the workflow becomes more agile: everyone looks for more effective mechanisms to deliver results and, thus, ensure that the quality of the work developed reaches the expected result.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(54, 'AccessSystemOptions', 'Acessando as Opções do Sistema', 'Accessing System Options', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(55, 'CustomAppearance', 'Personalizando o Sistema', 'Custom Appearance', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(56, 'DataBaseUpdate', 'Para atualizar dados existentes em uma tabela, é usada a função "<b>update()</b>", com os parâmetros "<b>campos</b>", "<b>tabela</b>" e "<b>where</b>" (Opcional). Os valores deverão estar armazenados previamente em um "<b>array</b>".', 'To update existing data in a table, the "<b> update () </ b>" function is used, with the "<b> fields", "<b> table </ b>" and "<b> where </ b>" (Optional). The values must be previously stored in an "<b> array </ b>".', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(57, 'DataBaseDelete', 'Seguindo a regra, há também a função "<b>delete()</b>" que permite a exclusão de um registro da tabela. Os parâmetos são "<b>tabela</b>" e a cláusula "<b>where</b>".', 'Following the rule, there is also the "<b> delete () </ b>" function that allows deletion of a record from the table. The parameters are "<b> table </ b>" and the "<b> where </ b>" clause.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(58, 'DataBaseQuery', 'Quando necessário, o programador pode utilizar uma "<b>query</b>" genérica para resolver alguma questão específica. A função a ser utilizada é a "<b>query()</b>", passando como parâmetro a query SQL integral em sua sintaxe normal. Embora seja muito prática, o uso dessa função não é recomendada, pois pode trazer incompatibilidade quando houver uma mudança no banco de dados utilizado (de "MySQL" para "PostGreSQL", por exemplo).', 'When needed, the programmer can use a generic "<b> query </ b>" to solve some specific question. The function to be used is "<b> query () </ b>", passing as parameter the integral SQL query in its normal syntax. Although very practical, the use of this function is not recommended, as it can bring incompatibility when there is a change in the database used (from "MySQL" to "PostGreSQL", for example).', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(59, 'DataBaseQueryDebug', 'Um recurso extremamente útil para "debugar", é o parametro final (opcional), que funciona em todas as funções descritas anteriormente: Inclua o parâmetro "1" para que a função ao invés de executar, apenas exiba na tela a query SQL resultante e interrompa o programa. ', 'An extremely useful feature for "debugging" is the final (optional) parameter, which works in all the functions described above: Include the parameter "1" so that the function instead of executing only displays the resulting SQL query and stop the program.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(60, 'UsingPermissionsOne', 'O recurso de permissões possibilita ao sistema, definir quais os recursos que podem ser acessados por cada grupo de usuário. Por exemplo: Um usuário cadastrado como <b>Administrador</b> pode alterar os dados dos demais usuários; um usuário cadastrado como <b>Operador</b> não terá acesso ao sistema de cadastro de usuários. E assim por diante...', 'The permissions feature enables the system to define which resources can be accessed by each user group. For example: A user registered as <b> Administrator </ b> can change the data of other users; a user registered as <b> Operator </ b> will not have access to the user registration system. And so on...', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(61, 'UsingPermissionsTwo', 'Essa "<b>permissão</b>" é colocada no código. A sintaxe está exemplificada acima. No caso, é verificado se o usuário que está logado (a função conhece o ID do usuário) tem a permissão para "Ver" ("<b>View</b>") o código protegido. Esse código é nomeado no caso, como "<b>UsersReport</b>" ("Relatório de Usuários"). A "permissão" é checada perante a tabela do banco de dados "<b>syspermissions</b>" que trará o resultado "Verdadeiro" ou "Falso", dependendo do que estiver cadastrado nessa tabelela, através do <b>Cadastro de Permissões</b> do sistema.</p>\r\n<p><b>Nota</b>: Quando o programador cria uma nova permissão, ela é automaticamente inserida na tabela "<b>syspermissions</b>" como habilitada para qualquer usuário. Depois ela pode ser alterada para cada grupo de usuários através do <b>Cadastro de Permissões</b> do sistema.', 'This "<b> permission </ b>" is placed in the code. The syntax is exemplified above. In this case, it is checked whether the user who is logged in (the function knows the user ID) has the "View" ("<b> View </ b>") permission to the protected code. This code is named in the case, such as "<b> UsersReport </ b>" ("User Report"). The "permission" is checked against the database table "<b> syspermissions </ b>" which will give the "True" or "False" result, depending on what is registered in that table, through <b> Permissions </ b>. </ P>', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(62, 'UsingTranslationOne', 'Existe no sistema a tabela "<b>syslanguages</b>". Nela, estão as traduções para centenas de expressões utilizadas nos scripts que compõem o sistema. Por padrão, existem as línguas Português e Inglês já preenchidas. Mas o número de línguas possíveis é ilimitado: Basta acrescentar uma coluna de um novo idioma nessa tabela.', 'There exists in the system the table "<b> syslanguages </ b>". In it are the translations for hundreds of expressions used in the scripts that make up the system. By default, Portuguese and English already exist. But the number of possible languages is unlimited: Just add a column of a new language in this table.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(63, 'UsingTranslationTwo', 'O código, como visto acima, é extremamente simples: Uma simples função que traduz a expressão passada como parâmetro para a linguagem selecionada no login do sistema. na programação, cada nova palavra ou expressão inserida para tradução, é automáticamente adicionada na tabela. A nova palavra ou expressão pode ser traduzida para os idiomas cadastrados através do módulo de <b>Gerenciamento de Linguagem</b>.', '', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(64, 'EventsLogOne', 'O recurso de gravar os eventos ocorridos no sistema é de imensa utilidade em diversos sentidos. A plataforma oferece uma função específica para essa finalidade. Ela pode ser utilizada ao final de cada página ou ao término de cada operação que se deseja que fique registrada.', '', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(65, 'EventsLogTwo', 'A sintaxe é extraordináriamente simples: Basta usar a função "<b>logWrite()</b>" contento os parâmetros preenchidos de acordo com sua necessidade. O primeiro parãmetro é obrigatório: descreve a ação ocorrida. O segundo parâmetro, ao gupo a que essa ação pertence. No caso "Ver" ("<b>View</b>"), "Tutorial Página 1" ("<b>TutorialPage1</b>").', '', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(66, 'EventsLogTree', 'Mas não para por aí. Outros parâmetros opcionais podem enriquecer os dados armazenados. No tutorial sobre <a href=database.php>Banco de Dados</a>, na demonstração da função "<b>delete()</b>", foi colocada a função "<b>logWrite</b>" quando a operação fosse corretamente efetuada. Veja o código acima.', '', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(67, 'EventsLogFour', 'No código acima, está mostrada a primeira linha da função, com todos os seus parâmetros existentes. É fácil deduzir a finalidade de cada um. Apenas um detalhe: Os dois últimos ("UserID" e "CompanyID") quando não preenchidos, guardam os dados do usuário que está operando o sistema. Podem ser preenchidos opcionalmente quando necessário registrar um evento de um outro usuário.</p>\r\n<p><b>Nota</b>: Os registros ficam armazenados na tabela "<b>sysevents</b>", com campos adicionais, automaticamente preenchidos como: Data do Evento, Características do Navegador do usuário etc.. ', '', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(68, 'TableFunctionsOne', 'A plataforma trás recursos fantásticos para facilitar e melhorar a aplicação de tablelas para o seu layout de página. Veja o simples código abaixo:', '', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(69, 'TableFunctionsR1', 'Repare na tag "<b>table</b>": É colocada uma "<b>classe</b>" que faz com que a renderização da tabela use os padrões de CSS da biblioteca. O visual da tabela fica muito mais atraente:', '', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
