INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(80, 'AccessSystemOptionsOne', 'No módulo "<b>Opções do Sistema</b>", o usuário pode selecionar alumas opções que alteram o comportamento do sistema. Novas opções podem ser criadas pelo programador, como veremos a frente. Observe o código: ', '', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(81, 'AccessSystemOptionsTwo', 'Essa consulta à "<b>opção</b>" é colocada no código. A sintaxe está exemplificada acima. No caso, . O valor retornado pela consulta à "opção" é checada na tabela do banco de dados "<b>sysoptions</b>".</p>\r\n<p><b>Nota 1</b>: Quando o programador cria uma nova consulta à opção, ela é automaticamente inserida na tabela "<b>sysoptions</b>". Depois ela pode ser alterada através do módulo "<b>Opções do Sistema</b>".\r\n<p><b>Nota 2</b>: O módulo <b>Preferências do Usuário</b> funciona de forma idêntica, e guarda os dados na tebela "<b>syspreferences</b>". A diferença entre "<b>Opções do Sistema</b>" e "<b>Preferências do Usuário</b>" é que as opções aplicam-se ao sistema e todos os seus usuários enquanto as preferências referem-se a cada usuário.', '', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(82, 'CustomAppearanceOne', 'Todos os arquivos ("css" e imagens) que são usados para compor o visual do sistema estão na pasta "<b>\\assets</b>", localizada na raiz do diretório. Os arquivos estão organizados em pastas de acordo com sua função. Os arquivos que podem ser alterados ("css" e imagens) tem em seu nome a expressão "-template". Esses arquivos são carregados quando não existem os homônimos sem a expressão mencionada. Ou seja, se você inserir na pasta "<b>\\css</b>", um arquivo "<b>login.css</b>" ele será carregado no lugar do "<b>login-template.css</b>". Dessa forma, o arquivo poderá ser alterado sem que seja substituido na atualização do sistema.</p>\r\n<p>O sistema foi desenvolvido de maneira que seja apenas necessário mudar as imagens e as folhas de estilo para que todo o visual seja modificado. Veja esse estilo alternativo para a página de "<b>login</b>": ', '', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(83, 'CustomAppearanceTwo', 'Experimente fazer o download do arquivo <a href=files/login.css target=_blank>login.css</a> e salvá-lo na pasta "<b>\\assets\\css</b>", localizada na raiz do sistema.', '', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
